import { SuperHero } from "../types";
import SuperheroDetails from "../components/Superhero";

interface ProductProps {
  productInfo: SuperHero[];
}

function ProductList(productpageProps: ProductProps) {
  const products = productpageProps.productInfo;

  return (
    <>
      <h1>All SuperHero</h1>

      {products.map((productDetails: SuperHero) => {
        return (
          <div>
            <SuperheroDetails productInfo={productDetails} />
          </div>
        );
      })}
    </>
  );
}

export default ProductList;
